		size_t UTF(unsigned char * Data, const wchar_t * Str) {
			size_t i, j, len = 0;
			for (i = 0; Str[i]; i++) {
				const Wide2Utf & u = Wide2Utf_lut[Str[i]];
				for (j = 0; j < u.size; j++) {
					*Data = u.data[j];
					Data++;
					len++;
				}
			}
			return len;
		}

