		wstring UTF(const unsigned char * Utf, size_t sz) {
			if (!sz)return L"";
			unsigned char* utf = (unsigned char*)Utf;
			if (utf[0] == 0xef && utf[1] == 0xbb && utf[2] == 0xbf) {
				sz -= 3;
				utf += 3;
			}

			std::wstringstream ret;

			for (auto i = 0; i < sz; i++) {
				wchar_t tmp;
				char c1 = utf[i];
				int Count = 0;
				while (c1 & 0x80) {
					Count++;
					c1 <<= 1;
				}
				tmp = (0x7f >> Count)&utf[i];
				Count--;
				for (int j = 0; j < Count; j++) {
					i++;
					tmp = (tmp << 6) | (utf[i] & 0x3f);
				}
				ret << tmp;
			}
			return ret.str();
		}
		void UTF(wstring & out, const vector<unsigned char> & Utf) {
			out.clear();
			const unsigned char * utf = Utf.data();
			auto len = Utf.size();
			if (len) {
				int sz = 0;
				for (auto i = 0; i < len; i++) sz += 1 ^ (utf[i] >> 7);
				out.resize(sz);
				wchar_t * ret = &out[0];
				int index = 0;

				wchar_t tmp;
				for (int i = 0; i < sz; i++) {
					char c1 = utf[i];
					int Count = 0;
					while (c1 & 0x80) {
						Count++;
						c1 <<= 1;
					}
					tmp = (0x7f >> Count)&utf[i];
					Count--;
					for (int j = 0; j < Count; j++) {
						i++;
						tmp = (tmp << 6) | (utf[i] & 0x3f);
					}
					ret[index++] = tmp;
				}
				ret[index] = 0;
				return;
			}
		}
