		int Encode(unsigned char * Data, const wchar_t * Str) {
			int ret = 0, j;
			for (int i = 0; Str[i]; i++) {
				if (Str[i] <= 0x007f) {
					Data[ret++] = (unsigned char)Str[i];
					continue;
				} else {
					unsigned char rout[6];
					unsigned int bytes = Str[i] & 0x0000ffff, bitCount;
					for (bitCount = 0; (bitCount < 16) && ((0x0000ffff << (bitCount))&bytes); bitCount++);
					unsigned char first = 0x80;
					for (j = 0; bitCount; j++) {
						rout[j] = bytes & 0x3f;
						bytes >>= 6;
						first |= 0x40 >> j;
						bitCount -= 6;
						if ((j + 1 + bitCount) <= 8) {
							first |= bytes;
							break;
						}
					}
					Data[ret++] = first;
					while (j >= 0)
						Data[ret++] = rout[j--] | 0x80;
				}
			}
			Data[ret] = 0;
			return ret;
		}

		std::wstring Unescape(const std::wstring& x) {
			std::wstring ret;
			ret.reserve(x.size());
			int esc = 0;
			for (auto & c : x) {
				if (!esc) {
					if (c == L'\\') esc = 1;
					else ret.push_back(c);
				} else {
					switch (c) {
					case L'n': ret.push_back(L'\n'); break;
					case L't': ret.push_back(L'\t'); break;
					case L'r': ret.push_back(L'\r'); break;
					case L'\\': ret.push_back(L'\\'); break;
					default: ret.push_back(c); break;
					}
					esc = 0;
				}
			}
			return ret;
		}

